import React, {useState} from 'react'
import { BrowserRouter, Link, Routes, Route } from 'react-router-dom'
import './App.scss'
import Header from './components/Header'
import Home from './components/Home'
import { FaEdit, FaTrash } from 'react-icons/fa';

const endPoint = process.env.REACT_APP_API_URI || 'http://localhost:3001'
var text = ''
var uniqueKey = 1

export default function App() {
  const [keywords, setKeywords] = useState([])
  const [questions, setQuestions] = useState([])

  const fetchData = async () => {
    try {
      text = window.document.getElementById('text').value
      const response = await fetch(endPoint + '/keywords', {
        method: 'POST',
        headers: { 
          'Content-Type': 'application/json'
         },
        body: JSON.stringify({ 
          theText: text
        }) 
      });
      const data = await response.json();
      // console.log(data.keywords)
      setKeywords(data.keywords)
    } catch (error) {
      console.log(error);
    }
  };

  const fetchQuestions = async () => {
    try {
      const response = await fetch(endPoint + '/questions', {
        method: 'POST',
        headers: { 
          'Content-Type': 'application/json'
         },
        body: JSON.stringify({ 
          theText: text,
          keywords: keywords
        }) 
      });
      const data = await response.json();
      setQuestions(data.questions)
    } catch (error) {
      console.log(error);
    }
  };

  const chargeDemoText = async () => {
    try {
      const response = await fetch(endPoint + '/read-demo-file', {
        method: 'GET',
        headers: { 
          'Content-Type': 'application/json'
         }
      });
      const data = await response.json()
      window.document.getElementById('text').value = data.demoText
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div className="App">
      <Header />
      <BrowserRouter>
        <main className="App-main">
          <Routes>
            <Route path='/' element={
              <Home />
            }/>
            <Route path='/text' element={
              // <Text />
              <div className='textSide'>
                <p>Here you paste your text</p>
                <textarea id='text' className='textArea'></textarea>
                <div>
                  <button onClick={chargeDemoText}>use demo text</button>
                  <Link to='/keywords' onClick={fetchData} className='link'>
                      Search Keywords
                  </Link>
                </div>
              </div>
            }/>
            <Route path='/keywords' element={
              // <Keywords keywords={keywords}/>
              <div className='keywords'>
                <p>Founded Keywords:</p>
                <div className='keywords-container'>
                  {
                    keywords.map(key => <button key={key} className='key-button'>{key}</button>)
                  }
                </div>
                <Link to='/questions' onClick={fetchQuestions} className='link'>
                    Make Questions
                </Link>
              </div>
            }/>
            <Route path='/questions' element={
              // <Question />
              <div>
                <p>Final Questions:</p>
                <div>
                  {
                    questions.map(q => {
                      var options = q[1].split(',')
                      return <div key={uniqueKey++} className='question'>
                        <div>
                          <p>{q[0]}</p>
                          <p>a. {options[0]}</p>
                          <p>b. {options[1]}</p>
                          <p>c. {options[2]}</p>
                          <p>d. {options[3]}</p>
                        </div>
                        <div className='question-icons'>
                          <button>
                            <FaEdit size="2.5rem"/>
                          </button>
                          <button>
                            <FaTrash size="2.5rem"/>
                          </button>
                        </div>
                      </div>
                    })
                  }
                </div>
                <Link to='/' className='link'>
                    Finnish Process
                </Link>
              </div>
            }/>
          </Routes>


        </main>
      </BrowserRouter>
    </div>
  )
}
